<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width,initial-scale=1.0" />
    <link rel="icon" href="<%= BASE_URL %>favicon.ico" />
    <link rel="preconnect" href="https://fonts.gstatic.com" />
    <link
      href="https://fonts.googleapis.com/css2?family=Bebas+Neue&display=swap"
      rel="stylesheet"
    />
    <title><%= htmlWebpackPlugin.options.title %></title>
  </head>
  <body>
    <noscript>
      <strong
        >We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work
        properly without JavaScript enabled. Please enable it to
        continue.</strong
      >
    </noscript>
    <div id="app"></div>
    <!-- built files will be auto injected -->
    <script src="https://static-file.platform.kemai.com.cn/lib/vue/2.5.2/vue.min.js"></script>
    <script src="https://static-file.platform.kemai.com.cn/lib/vue-router/3.0.1/vue-router.min.js"></script>
    <script src="https://static-file.platform.kemai.com.cn/lib/vuex/3.0.1/vuex.min.js"></script>
    <script src="https://static-file.platform.kemai.com.cn/lib/axios/0.18.0/axios.min.js"></script>
  </body>
</html>
